import './App.css';
import Login from './feature/login/login';
import Layout from './Components/layout';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
    <Routes>
          <Route exact path="/" element={<Layout />}>
          <Route exact path="/layout" element={<Login />} />
        </Route>
    </Routes>
  </BrowserRouter>
      {/* <Layout /> */}
        {/* <Login /> */}
    </div>
  );
}

export default App;
